import React from 'react';

const Weather = ({weather}) => {

    return(
       <ul>
           {weather.map(weathers => (
               <li key={weathers.coord.id} >
                   {weathers.coord.id}
               </li>
           ))}
       </ul>
    );
};

export default Weather;
